import React from 'react';

const menuItem = [
    { id: 1, name: 'home'},
    { id: 2, name: 'portfolio'},
    { id: 3, name: 'about us'},
    { id: 4, name: 'price'},
    { id: 5, name: 'contacts'}
];

const Menu = ({items}) => (
    <ul>
        {items.map(item => (
            <li>{item.name}</li>
        ))}
    </ul>
);

export default Menu;
